// Navbar.js

import React from 'react';
import { useNavigate, Routes, Route } from 'react-router-dom';
import navLogo from '../../navLogo.jpg';
import './navbar.css';

// Lazy-loaded components
const EntityCreationForm = React.lazy(() =>
  import('../entityCreation/entityCreation')
);
const TransporterCreationForm = React.lazy(() =>
  import('../transporterCreation/transporterCreation')
);
const AssetEntryInfoForm = React.lazy(() =>
  import('../assetEntryInfo/assetEntryInfo')
);
// Import other lazy-loaded components...

const Navbar = () => {
  const navigate = useNavigate();

  const handleFormClick = (path) => {
    navigate(path);
  };

  return (
    <div className='navbar-main'>
      <div className='logo-container'>
        <img src={navLogo} alt='Logo' className='logo' />
        <div className='brand-text'>
          <span>NavitronicX</span>
        </div>
      </div>
      <div className='menu-container'>
        <button className='menu-button'>Menu</button>
        <div className='dropdown-content'>
          <Routes>
            <Route
              path='/entityCreation'
              element={<EntityCreationForm />}
            />
            <Route
              path='/transporterCreation'
              element={<TransporterCreationForm />}
            />
            <Route
              path='/assetEntryInfo'
              element={<AssetEntryInfoForm />}
            />
            {/* Add routes for other components */}
          </Routes>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
